'''Yewnock''' is the son of [[Oaknock the Engineer]]. He developed [[gnome glider]]s based on the toys his father used to make.{{CiteNPC|npc=Varrock Museum{{!}}Display case 10|loc=Varrock Museum|quote= They did mention that an old gnome engineer called Oaknock used to make model gliders for his children. Oaknock's son, Yewknock, ended up creating this method of transport with inspiration from his father's models. Captain Daerkin and Captain Ninto were said to be test pilots of the initial prototypes, though enquiries have proved them to be reticent to give much information.}} Nothing else is known about him or his sibling(s), but given the lifespan of gnomes and the fact that the test pilots of his first prototypes are still alive, it is possible that Yewnock still lives.

